import React from 'react';


function About() {
  return (
    <section class="about">
      <h1 id="about">About Me</h1>
      <p>I'm Jagyanseni Das. I've 10+ year's of working experience in IT Industry. <br/>
        I've expertise in: Salesforce Marketing Cloud,Mulesoft,MERN stack. <br/>
        A good Team player as well :) <br/>
      </p>
    </section>
  );
  }

export default About;
